  [],\n\t\"title\": \"f690sc.m77t and f690sc.h77t: MGD77T data and header files for
  single-beam bathymetry data for field activity F-6-90-SC in Southern California,
  Monterey Canyon from 06/19/1990 to 07/12/1990\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  2,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-06-17T02:34:36.664086\",\n\t\"name\": \"f690sc-m77t-and-f690sc-h77t-mgd77t-data-and-header-files-for-single-beam-bathymetry-dat-12-1990\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Single-beam bathymetry data along with
  Loran-C RHO-RHO and GPS navigation data was collected as part of the U.S. Geological
  Survey cruise F-6-90-SC. The cruise was conducted in Southern California, Monterey
  Canyon from June 19 to July 12, 1990. The chief scientists were Jim Gardner from
  the USGS Coastal and Marine Geology office in Menlo Park, CA and Doug Masson. The
  purpose of this cruise was to survey with midrange sidescan sonar (TOBI: towed ocean
  bottom instrument).The geophysical source was 12 kilohertz (kHz), 7 kHz, and 3.5
  kHz systems. These data are reformatted from space-delimited ASCII text files located
  in the Coastal and Marine Geology Program (CMGP) InfoBank field activity catalog
  at http://walrus.wr.usgs.gov/infobank/f/f690sc/html/f-6-90-sc.meta.html into MGD77T
  format provided by the NOAA's National Geophysical Data Center(NGDC). The MGD77T
  format includes a header (documentation) file (.h77t) and a data file (.m77t). More
  information regarding this format can be found in the publication listed in the
  Cross_reference section of this metadata file.\",\n\t\"license_title\": null,\n\t\"extras\":
